script: |
  super -f text -I q11146.spq | sort > q11146.out

inputs:
  - name: q11146.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE col0 NOT BETWEEN col1 * + 32 * - col2 * - - 11 - + + col0 AND ( + col1 * - 40 );
  - name: tab0

outputs:
  - name: q11146.out
    data: |
      15	81	47
      87	21	10
      97	1	99
